def multi_fresher():
    global file, config
    try:
        with open('config.json', 'r', encoding='utf-8') as config_file:
            config = json.load(config_file)
            print(config)
    except FileNotFoundError:
        notification('Ð¤Ð°Ð¹Ð» ÐºÐ¾Ð½Ñ„Ð¸Ð³Ð° Ð½Ðµ Ð¾Ð±Ð½Ð°Ñ€ÑƒÐ¶ÐµÐ½', False, 'ÐšÐ¾Ð½Ñ„Ð¸Ð³', (150, 150))
    filename = file
